import Checkbox from "./Checkbox";

export default function Task({ name, done, onToggle }) {
  const handleCheckboxChange = () => {
    onToggle(!done);
  };

  return (
    <div className="task">
      <Checkbox checked={done} onClick={handleCheckboxChange} />
      {name}
    </div>
  );
}
